import React, {
    Component
} from 'react';
import './Hello.css';

const prop = this.props;

class Hello extends Component {
    render() {
        return (
            <div className = 'f1 tc' >
                <h1>Hello World</h1>
                <p>Welcome to React!</p>
                <p>This was created by {prop.creator}</p>
            </div>
        );
    }
}

export default Hello;
